import React from "react";
import { Container } from "react-bootstrap";
import styled from "styled-components";

const LoginCard = styled.div`
width: 40%;
display: flex; 
flex-direction: column;
`;

const LoginImage = styled.div`
width: 30%;
heigth: fit-content;
`;
const Inputs = styled.div`
display: flex; 
flex-direction: column; 
justify-content: center
`;

export const Login = () => {
  return (
    <Container className="d-flex flex-row justify-content-center align-item-center">
      <LoginCard>
        <h1>Login</h1>
        {/* <!-- Email input --> */}
        <Inputs>
          <input type="email" id="form2Example1" class="form-control" />
          <label class="form-label" for="form2Example1">
            Email address
          </label>
        </Inputs>
        {/* <!-- Password input --> */}
        <Inputs>
          <input type="password" id="form2Example2" class="form-control" />
          <label class="form-label" for="form2Example2">
            Password
          </label>
        </Inputs>
        {/* <!-- Submit button --> */}
        <button type="button" class="btn btn-primary btn-block mb-4">
          Sign in
        </button>
      </LoginCard>
      <LoginImage>
        <img src="https://cdn.vox-cdn.com/thumbor/NbuLcqdukFWuOh9ioTRXJrjtThY=/0x0:1200x1200/1200x800/filters:focal(504x504:696x696)/cdn.vox-cdn.com/uploads/chorus_image/image/66680523/13_shoe_organizer_lede.w700.h700.2x.0.jpg" style={{width:"fit-content"}}></img>
      </LoginImage>
    </Container>
  );
};
